import React, { useState, useEffect } from 'react';
import { Modal, Button, Descriptions, Tag, Timeline } from 'antd';
import { eventAPI } from '../services/api';
import moment from 'moment';

const DecisionModal = ({ decision, visible, onClose }) => {
  const [fullEvent, setFullEvent] = useState(null);
  const [loading, setLoading] = useState(false);
  const [relatedEvents, setRelatedEvents] = useState([]);

  useEffect(() => {
    if (decision && visible) {
      loadEventDetails();
    }
  }, [decision, visible]);

  const loadEventDetails = async () => {
    if (!decision) return;
    
    try {
      setLoading(true);
      const eventRes = await eventAPI.getEvent(decision.event_id);
      setFullEvent(eventRes.data);
      
      // Find related events (same day or topic)
      const allEventsRes = await eventAPI.getEvents();
      const related = allEventsRes.data.filter(event => 
        event.id !== decision.event_id &&
        (moment(event.timestamp).isSame(moment(decision.timestamp), 'day') ||
         event.topic.category === eventRes.data.topic.category)
      ).slice(0, 5);
      
      setRelatedEvents(related);
    } catch (error) {
      console.error('Failed to load event details:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleTracebackToConversation = () => {
    // In a real implementation, this would navigate to the specific conversation
    // For now, we'll show an alert with the event details
    alert(`Tracing back to conversation at ${moment(decision.timestamp).format('YYYY-MM-DD HH:mm')}\n\nFull context: ${decision.context}`);
  };

  if (!decision) return null;

  return (
    <Modal
      title="Decision Details"
      visible={visible}
      onCancel={onClose}
      width={900}
      footer={[
        <Button key="traceback" type="primary" onClick={handleTracebackToConversation}>
          Traceback to Conversation
        </Button>,
        <Button key="close" onClick={onClose}>
          Close
        </Button>
      ]}
    >
      <Descriptions bordered column={2}>
        <Descriptions.Item label="Decision Maker" span={2}>
          <Tag color="blue">{decision.actor.sender}</Tag> ({decision.actor.role})
        </Descriptions.Item>
        <Descriptions.Item label="Timestamp">
          {moment(decision.timestamp).format('YYYY-MM-DD HH:mm:ss')}
        </Descriptions.Item>
        <Descriptions.Item label="Priority">
          <Tag color={decision.priority === 'High' ? 'red' : decision.priority === 'Medium' ? 'orange' : 'green'}>
            {decision.priority}
          </Tag>
        </Descriptions.Item>
        <Descriptions.Item label="Rationale" span={2}>
          {decision.rationale || 'No rationale provided'}
        </Descriptions.Item>
        <Descriptions.Item label="Expected Outcome" span={2}>
          {decision.expected_outcome || 'No expected outcome specified'}
        </Descriptions.Item>
        <Descriptions.Item label="Full Context" span={2}>
          <div style={{ maxHeight: '200px', overflowY: 'auto', padding: '8px', backgroundColor: '#f5f5f5', borderRadius: '4px' }}>
            {decision.context}
          </div>
        </Descriptions.Item>
      </Descriptions>

      {fullEvent && (
        <div style={{ marginTop: '24px' }}>
          <h4>Complete Event Information</h4>
          <Descriptions size="small" bordered>
            <Descriptions.Item label="Topic">
              {fullEvent.topic.category} - {fullEvent.topic.subtype}
            </Descriptions.Item>
            <Descriptions.Item label="Biomarkers">
              {fullEvent.topic.biomarkers.map(marker => (
                <Tag key={marker} size="small">{marker}</Tag>
              ))}
            </Descriptions.Item>
            <Descriptions.Item label="Travel Status">
              {fullEvent.travel.flag ? `${fullEvent.travel.region} - ${fullEvent.travel.location}` : 'Home'}
            </Descriptions.Item>
            {fullEvent.metrics.adherence_pct && (
              <Descriptions.Item label="Adherence">
                {fullEvent.metrics.adherence_pct}%
              </Descriptions.Item>
            )}
          </Descriptions>
        </div>
      )}

      {relatedEvents.length > 0 && (
        <div style={{ marginTop: '24px' }}>
          <h4>Related Events</h4>
          <Timeline size="small">
            {relatedEvents.map(event => (
              <Timeline.Item key={event.id}>
                <div style={{ fontSize: '12px' }}>
                  <strong>{event.actor.sender}</strong> - {moment(event.timestamp).format('HH:mm')}
                  <br />
                  {event.content.summary.slice(0, 1).join(' ')}
                </div>
              </Timeline.Item>
            ))}
          </Timeline>
        </div>
      )}
    </Modal>
  );
};

export default DecisionModal;
